import React from 'react';
import Header from './Header';
import Login from './Login';
import {Container,Row,Col } from 'react-bootstrap';
class Main extends React.Component {
    constructor()
    {
        super();

    }
    render() { 
        return ( 
            <Container fluid={true}>
  <Row>
    <Col style={{backgroundColor: 'yellow',height:'50px'}}><Header/></Col>
  </Row>
  <Row>
    <Col style={{backgroundColor: '#f1f1f1',height:'570px'}}>Features</Col>
    <Col style={{backgroundColor: 'pink',height:'570px'}}><Login/></Col>
  </Row>
  <Row>
      <Col style={{backgroundColor: 'orange',height:'37px'}}>Footer</Col>
  </Row>
</Container>
         );
    }
}
 
export default Main;
